import React from 'react';
import Logo from '../assets/logo/sportsee_logo.svg';

function Nav() {
  return (
    <header className="nav">
      <div className="nav__logo">
        <img src={Logo} alt="SportSee Logo" />
      </div>
      <nav className="nav__links">
        <a href="/">Accueil</a>
        <a href="/">Profil</a>
        <a href="/">Réglage</a>
        <a href="/">Communauté</a>
      </nav>
    </header>
  );
}

export default Nav;
